import './App.css';
import Header from './components/header/header';
import Navbar from './components/navbar/navbar';
import { BrowserRouter, Route } from 'react-router-dom';
import Profile from './components/content/Profile/Profile';
import Dialogs from './components/content/dialogs/Dialogs';
import PostsContainer from './components/content/MyPosts/PostsContainer';


function App(props) {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <div className="blockContent">

          {/* <Route path='/profile' component={Profile} /> */}
          {/* <Route path='/posts' component={Posts} />
          <Route exact path='/messages' component={Dialogs} /> */}

          <Route path='/profile' render={() => <Profile />} />
          <Route path='/posts' render={() => <PostsContainer store={props.store} />} />
          <Route exact path='/messages' render={() => <Dialogs store={props.store} />} />
        </div>
        <Navbar />


      </div>
    </BrowserRouter>

  );
}

export default App;
